@pukkaherbsus Matcha is a great alternative to coffee in the morning or afternoon.  It supports brain function, memory and concentration if you’re feeling like you're hitting the midday slump.  And it contains less caffeine than coffee and more antioxidants while still tasting delicious and giving that extra buzz of energy.  #pukkapartner

